//drawing a color to the specific x y location
void plot_pixel(int x, int y, short int line_color)
{
    *(short int *)(pixel_buffer_start + (y << 10) + (x << 1)) = line_color;
}
//check if the mouse hit the mouse trap
//check if pixels surrounding the mouse is black, then game over
bool check_contact(int x0, int y0, int x1, int y1)
{
	short int colour;
	bool contact=false;
	//look at the line right above the mouse
	if(y0>0)
	{
		for(int i = x0; i < x1 ; i++){
			colour=*(unsigned short int *)(pixel_buffer_start + ((y0 - 0) << 10) + (i << 1));
			if(colour!=BLACK)
			{
				contact=true;
			}
		}
		
	}
	//checking the line under the mouse
	if(y1<=239)
	{
		for(int i = x0; i < x1 ; i++){
			colour=*(short int *)(pixel_buffer_start + ((y1) << 10) + (i << 1));
			if(colour!=BLACK)
			{
				contact=true;
			}
		}
		
	}
	//checking the line in front
	for(int j = y0; j < y1 ; j++){
			colour=*(short int *)(pixel_buffer_start + ((j) << 10) + ((x1) << 1));
			if(colour!=BLACK)
			{
				contact=true;
			}
	}
	return contact;
}
//changing the buffers
void wait_for_vsync(){
	volatile int * pixel_ctrl_ptr = (int*)0xFF203020; //pixel controller
	register int status;
	
	*pixel_ctrl_ptr = 1; //start the synch process by writting a 1 
	
	status = *(pixel_ctrl_ptr + 3);
	while ((status & 0x01) != 0){
		status = *(pixel_ctrl_ptr + 3);
	}
}
//erasing the previous mouse location
void erase_mouse(int x0, int y0, int x1, int y1, int color)
{
	//x0,y0 is one vertice and x1,y2 is another
	//want to plot all the pixels within the boundarys
	for(int i = x0; i<x1;i++){
		for(int j = y0; j<y1; j++){
				plot_pixel(i, j, color);
			}
		}
}
//drawing mouse png at the location specified by x,y
void draw_mouse(int x, int y)
{
	int endx = x+MOUSE_Y-2;
	int endy = y+MOUSE_X;
	for(int i=x; i<endx; i++){
		for(int j=y; j<endy;j++){
			plot_pixel(j, i, tinymouse[i-x][j-y]);
		}
	}
}

//draws the mouse trap at the location specified by x,y
void draw_mouse_trap(int x, int y){//read from colour array->gloabl
	int x_count = 0;
	for(int x0 = x - 22; x0 <= x + 22; ++x0){
		int y_count = 0;
		for(int y0 = y - 20; y0 <= y + 20; ++y0){
			plot_pixel(x0, y0, mouse_trap[y_count][x_count]);// colour is image_array[x][y]
			y_count++;
		}
		x_count++;
	}
}

//draw black over mouse trap
void draw_mouse_trap_black(int x, int y, short int colour){//read from colour array->gloabl
	for(int x0 = x - 22; x0 <= x + 22 ; ++x0){
		for(int y0 = y - 20; y0 <= y + 20; ++y0){
			plot_pixel(x0, y0, colour);
		}
	}
}
